import React from "react";
import styled from "styled-components";
import {Link} from "react-router-dom";
import Icon from "../components/Icon";
const HomeButton = styled.a`
    position: fixed;
    top: 30px;
    left: 30px;
    height: 30px;
    width: 30px;
`

function tagsSettings(){
    return (
        <header>
            <HomeButton href='../'>
                <Icon name="home">
                </Icon>
            </HomeButton>
        </header>
    )
}
export default  tagsSettings;
